import { Box, TextField } from '@mui/material'
import React from 'react'
import SearchIcon from '@mui/icons-material/Search';
import './menu.css'

function menu() {
    return (
        <Box>
            <TextField sx={{width:'80%',height:'2rem'}} fullWidth label="" id="fullWidth" />
            <Box>
                <SearchIcon/>
            </Box>
        </Box>
    )
}

export default menu
